export default function ViewTodo({ data ,dispatch}) {
  // console.log(data,'koky')
  return (
    <div className="mt-2 fs-5">
      {data.map((todo) => {
        return (
          <ul className="ms-5">
            <li> 

                {todo.name}
                <button className="btn btn-success ms-2">Toggle</button>
                <button className="btn btn-danger ms-2">Delete</button>
            </li>

          </ul>
        );
      })}
    </div>
  );
}
